import React from "react";
import { Link } from "react-router-dom";

const RightRoom = () => {
  return (
    <div>
      <h1>Right room</h1>
      <h2>SLENDER APPEARS - GAME OVER</h2>
      <Link to="/start">Start over</Link>
    </div>
  );
};

export default RightRoom;
